import React from 'react';

const User = ({ user }) => {
    return ( 
        <>
        <table style="width:100%">
        <tr>
            <th>Company</th>
            <th>Contact</th>
            <th>Country</th>
        </tr>
        <tr>
            <td>Alfreds Futterkiste</td>
            <td>Maria Anders</td>
            <td>Germany</td>
        </tr>
</table>
            <h1>{user.name}</h1>
        </>
     );
}

export default User;
